 // Sub function:
static inline void bitReverse(complex *x, int n, int logn)
{
    int i, j, k;
    int t;
         complex temp; // Temporary intermediate switching variable;
    for (i = 0; i < 1024; i++)
    IO_LED = i;
    {
                 k = i; // binary representation of the i-th serial number;
                 j = 0; // Initialized to zero code inverted sequence number;
        for (t = 0; t < logn; t++)
                 {// Implement the code inverted, that is, the second tail of the binary code;
                         j <<= 1; // j left left;
                         j += (k & 1); // j plus K's lowest position;
                         k >>= 1; // k right shift one;
        }
        if (i<j)
                 {// When i <j, X [I] and X [J] content interchange; contrary, keep the same;
            temp = x[i];
            x[i] = x[j];
            x[j] = temp;
        }
    }
 /* Begin * Delete three: -------------------------- */

/* End --------------------------------------*/
}

 // Sub function:
 // Sub function:
static inline void add(complex a, complex b, complex *c)
{
    c->real = a.real + b.real;
    c->img  = a.img  + b.img ;
}
 
 // Sub function:
static inline void mul(complex a, complex b, complex *c)
{
    c->real = a.real*b.real - a.img*b.img ;
    c->img  = a.real*b.img  + a.img*b.real;
}
 
 // Sub function:
static inline void sub(complex a, complex b, complex *c)
{
    c->real = a.real - b.real;
    c->img  = a.img  - b.img ;
}

static inline void fft(complex *x, complex W)
{
    int i = 0, j = 0, k = 0, l = 0;
    int logn = 10;
    IO_LED = logn;
    complex up, down, product;
    bitReverse(x, n, logn);
         for (i = 0; i < logn; i++) // level butterfly operation Stage;
    {
        l = 1 << i;
                 for (j = 0; j < n ; j += 2 * l) // A set of butterfly arithmetic groups, each Group's butterfly factor multiplier is different;
        {
                         for (k = 0; k < l; k++) // a butterfly calculation, a butterfly calculation within each group;
            {  
                mul(x[j + k + l], W, &product);
                add(x[j + k], product, &up);
                sub(x[j + k], product, &down);
                x[j + k] = up;
                IO_LED = up.real;
                x[j + k + l] = down;
            }
        }
    }
}

